import React from 'react';
import { StyleSheet, View } from 'react-native';

class Calling extends React.Component {
    constructor(props) {
        this.state = {
            startButton:true,
            callButton:false,
            hangupButton:false,
            stopButton:false,
        }
        this.startLocalVideo = this.startLocalVideo.bind(this)
    }

    render() {
        <View class="buttons">
            {/* add start button: starts local video  */}
            <Button title="start" disabled={startButton} onPress={this.startLocalVideo} />

            {/* add call button: calls remote video  */}
            <Button title="call" disabled={callButton} onPress={this.connectRemoteVideo} />

            {/* add hang-up button: stops remote video  */}
            <Button title="hang up" disabled={hangupButton} onPress={this.stopRemoveVideo} />

            {/* add stop: stops local video */}
            <Button title="stop" disabled={stopButton} onPress={this.stopLocalVideo} />
        </View>
    }

    startLocalVideo() {
        alert("start local video")
        this.setState({callButton:true})
        this.setState({startButton:false})
    }

    connectRemoteVideo() {
        alert("connect to remote video")
    }

    stopRemoteVideo() {
        alert("stop remote video")
    }

    stopLocalVideo() {
        alert("stop local video")
    }

}

export default Calling;
